import React,{Component} from 'react';
import '../stylesheets/ShowTheatres.css';

class ShowTheatres extends Component
{
    componentDidMount() {
        console.log(this.props);
    }
    render() {
        return (
            <div className = "ShowTheatresBox">
                <div className = "SingleTheatreBox">
                    <h4 className= "MovieName">INOX</h4>
                    <button>10:30 AM</button>
                    <button>4:00 PM</button>
                    <button>7:00 PM</button>
                </div>
                <div className = "SingleTheatreBox">
                    <h4>INOX</h4>
                    <button>10:30 AM</button>
                    <button>4:00 PM</button>
                    <button>7:00 PM</button>
                </div>
            </div>
        )

    }
}

export default ShowTheatres;
